import React from "react";
import { Button, Container, TextField } from "@material-ui/core";
import DeleteIcon from "@material-ui/icons/Delete";
import {
  Card,
  CardActionArea,
  CardMedia,
  makeStyles,
  CardContent,
  Typography,
  AppBar,
  Toolbar,
} from "@material-ui/core";
const useStyles = makeStyles((theme) => ({
  button: {
    backgroundColor: "#C7DFC1",
    color: "#1B224A",
    margin: "10px",
    textAlign: "center",
    border: "none",
  },
  nav: {
    backgroundColor: "#1B224A",
    color: "white",
    fontFamily: "Rosarivo",
    display: "flex",
    justifyContent: "space-between",
  },
  small: {
    display: "none",
    [theme.breakpoints.up("sm")]: {
      display: "block",
    },
  },
  large: {
    display: "block",
    [theme.breakpoints.up("sm")]: {
      display: "none",
    },
  },
  textarea: {
    marginTop:'10px',
    marginBottom:'10px',
    width:'300px',
    padding:'2vh',
    outline:'none',
    fontSize:'2.5vh'
  },
}));
export default function Navbar(props) {
  const classes = useStyles();
  return (
    <>
      <AppBar position="static" >
        <Toolbar className={classes.nav}>
          <Typography variant="h6" className={classes.small}>
            E-CART
          </Typography>
          <Typography variant="h6" className={classes.large}>
            E-CART
          </Typography>
          <div>
            <Button
              onClick={props.changelog}
              variant="contained"
              color="success"
              className={classes.button}
            >
              Log in
            </Button>
            <Button
              onClick={props.changelog}
              variant="contained"
              color="success"
              className={classes.button}
            >
              Sign up
            </Button>
          </div>
        </Toolbar>
      </AppBar>
    </>
  );
}
